import logo from './logo.svg';
import './App.css';
import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    useRoutes,
  } from "react-router-dom";
import IntroPage from './components/IntroPage/IntroPage'
import QuestionsPage from "./components/QuestionsPage/QuestionsPage";
import DatePage from "./components/DatePage/DatePage";
import CompletionPage from "./components/CompletionPage/CompletionPage";
import Navbar from './components/Navbar/Navbar';

function App() {
    return (
        <Router>
            <Navbar />
            <Switch>
                <Route path="/" component={IntroPage} exact />
                <Route path="/questions" component={QuestionsPage} />
                <Route path="/date" component={DatePage} />
                <Route path="/completion" component={CompletionPage} />
            </Switch>
        </Router>
    )
}

export default App;
